  \"2016-03-17T20:52:19.092276\",\n\t\"name\": \"local-government-budget-and-financial-report-database\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Local Government Budget and Financial
  Report Database provides the public access to current and official versions of budgets
  for Counties, County Ag Extensions, County/City Assessors, County Hospitals, & Townships,
  Benefited Fire, Lighting, Water Districts, and Misc Budgets (DART, EMC, E911, Rural
  Improvement Zones, Recreational Water, Sanitary Sewer Districts). The public has
  access to multiple forms that are part of the budget. The database also provides
  the public access to annual financial reports for Counties. The site provides both
  GAAP and Cash Financial Reports for multiple fiscal years.\",\n\t\"license_title\":
